/* Store in memory */
PRAGMA temp_store = 2;

DROP TABLE IF EXISTS [tmpNewModels];

CREATE TEMP TABLE [tmpNewModels] (
       [Make]  TEXT,
	   [Model] TEXT);
	   

       [MakeID],
	   [Name])
SELECT [MAK].[ID] AS [MakeID],
       [NEW].[Model]
  FROM [tmpNewModels] AS [NEW]
       INNER JOIN [Makes] AS [MAK]
	           ON [MAK].[Name] = [NEW].[Make]
       LEFT OUTER JOIN [Models] AS [MOD]
	                ON [MOD].[MakeID] = [MAK].[ID]
 WHERE [MOD].[ID] IS NULL;

DROP TABLE [tmpNewModels];